import React from "react";
import { CheckoutContextProvider } from "../../context/checkoutcontext/CheckoutContext";
import { CheckOutFlow } from "../checkoutflow/CheckOutFlow";
import { PersonalNameEditor } from "../personalnameeditor";
import { ProductOffers } from "../productoffer/ProductOffers";
import { CheckoutSummary } from "../checkoutsummary/CheckoutSummary";
import { Payment } from "../../components/paymentformcard/Payment";
import { AddressEditor } from "../addresseditor";


interface Props {
}



export const Onboarding: React.FC<Props> = (Props) => {


const steps = [
    "Persönliche Daten",
    "Adressdaten",
    "Bezahldaten",
    "Bestellung",
    "Zusammenfassung"
]


   return (
        <CheckoutContextProvider>
            <CheckOutFlow steps={steps}>
                <PersonalNameEditor />
                <AddressEditor />
                <ProductOffers />
                <Payment />     
                <CheckoutSummary />
            </CheckOutFlow>
        </CheckoutContextProvider>
    )
}
